protected boolean assertOrder(List<Tuple> tuples, int... ids) throws Exception {
  int i = 0;
  for(int val : ids) {
    Tuple t = tuples.get(i);
    Long tip = (Long)t.get("id");
    if(tip.intValue() != val) {
      throw new Exception("Found value:"+tip.intValue()+" expecting:"+val);
    }
    ++i;
  }
  return true;
}

